import Title from "./Title";
import GameBoard from "./GameBoard";
import "./App.css";

const App = (startGame = false) => {
  if (startGame) {
    return <GameBoard />;
  } else {
    return (
      <>
        <Title />
      </>
    );
  }
};

export default App;
